$(function () {
  'use strict';
  var cities = $.map(CitiesFa, function (value, key) { return { value: value, data: key }; });
  var cities2 = $.map(CitiesEn, function (value, key) { return { value: value, data: key }; });
  var cities = cities.concat(cities2);
  $('.city-autocomplete').devbridgeAutocomplete({
    lookup: cities,
    minChars: 2,
  });
  function getKeyByValue(object, value) {
    return Object.keys(object).find(key => object[key] === value);
  }
  $("#wego_submit").on('click', function(e) {
    e.preventDefault();
    var gotohomepage = false;
    var src = getKeyByValue( CitiesFa, $('#wego_src').val() );
    if (!src) src = getKeyByValue( CitiesEn, $('#wego_src').val() );
    if (!src) gotohomepage = true;
    var des = getKeyByValue( CitiesFa, $('#wego_des').val() );
    if (!des) des = getKeyByValue( CitiesEn, $('#wego_des').val() );
    if (!des) gotohomepage = true;
    if (gotohomepage) {
      window.open("https://www.wego.ir/flights?wg_source=mediaad&wg_medium=digiato_htmlbanner&wg_campaign=fixed_html5&wg_term=" + src + "&wg_content=" + des);
    } else {
      window.open("https://www.wego.ir/flights/" + src + "/" + des + "?wg_source=mediaad&wg_medium=digiato_htmlbanner&wg_campaign=fixed_html5&wg_term=" + src + "&wg_content=" + des);
    }
  });
});